import React from 'react';
import  {Nav, NavbarContainer, NavbarLogo} from './NavbarStyle';
const Navbar = () => {
  return (
    <>
      <Nav>
        <NavbarContainer>
          <NavbarLogo to='/'>Zokko</NavbarLogo>
          {/* Mobile */}
          <MobileIcon>
              <FaBars/>
          </MobileIcon>
          <NavbarMenu>
              <NavbarItem>
                  <NavbarLink to='about'>About</NavbarLink>
              </NavbarItem>
          </NavbarMenu>
        </NavbarContainer>
      </Nav>
    </>
  );
};

export default Navbar;
